export const Constructor = () => {
    return (
        <div>
            <Header/>
            <div className="WrapperConstructor">
                <h1 className="MainTitleConstructor">Добро пожаловать
                    в конструтор!</h1>
                <LineForMainTitle/>
                <div className="BlockForChoose">

                </div>
            </div>
            <Footer/>
        </div>
    )
}

export default Constructor;
